@commands.Cog.listener(name='on_message')
async def listen_for_github_request_in_message(self, msg: discord.Message):
    if any([self.ready, self.bot.setup_finished, self.listen_for_github_request_in_message_enabled is False]) is False:
        return

    if BranchItem.is_waiting_for_rate_limit_reset is True:
        return

    channel = msg.channel
    author = msg.author
    if channel.type is discord.ChannelType.private:
        return
    if author.bot is True:
        return

    if channel.id == self.github_webhook_channel_id:
        await self.make_branches()
        return

    request_match = self.github_request_regex.search(msg.content)
    if not request_match:
        return

    prefix, branch_name, request_identifier = request_match.groups()
    if request_identifier.isnumeric():
        request_identifier = int(request_identifier)
        asyncio.create_task(self._send_github_issue(request_identifier, channel, author, msg))

    else:
        asyncio.create_task(self._send_github_file(branch_name, request_identifier, channel, author, msg))

@commands.Cog.listener(name='on_raw_reaction_add')
async def subscription_reaction(self, payload):
    if any([self.ready, self.bot.setup_finished]) is False or self.bot.is_debug is True:
        return
    try:
        channel = self.bot.get_channel(payload.channel_id)
        message = await channel.fetch_message(payload.message_id)
        if message not in [topic.message for topic in self.topics]:
            return
        topic = {topic.message: topic for topic in self.topics}.get(message)
        emoji_name = normalize_emoji(payload.emoji.name)
        if emoji_name != normalize_emoji(topic.emoji):
            for reaction in message.reactions:
                if normalize_emoji(str(reaction.emoji)) != normalize_emoji(topic.emoji):
                    await message.clear_reaction(reaction.emoji)
            return
        reaction_user = await self.bot.fetch_antistasi_member(payload.user_id)
        if reaction_user.bot is True:
            return
        if topic.role in reaction_user.roles:
            await reaction_user.send(f"You already have the role `{topic.role.name}`.\nThis should not have been possible, please contact Giddi!")
            return
        await self._give_topic_role(reaction_user, topic)
        await self.sucess_subscribed_embed(reaction_user, topic)

    except discord.errors.NotFound:
        return

